(function execute(inputs, outputs) {
    outputs.last_successful_run_date = new ImportSetUtilsSNC().getConvertedDate(inputs.service_job_tracker.getValue('start_date_time_api_parameter'));
    outputs.last_successful_run_date_time = new ImportSetUtilsSNC().getConvertedDateTime(inputs.service_job_tracker.getValue('start_date_time_api_parameter'));

})(inputs, outputs);

